import React from 'react';
import { FiLogOut, FiShoppingBag, FiStar, FiUnlock, FiUser } from 'react-icons/fi';

const listMenuUser: { id: number, icon: any, name: string }[] = [
    {
        id: 1,
        icon: <FiUser></FiUser>,
        name: "listuser1"
    },
    {
        id: 2,
        icon: <FiShoppingBag></FiShoppingBag>,
        name: "listuser2"
    },
    {
        id: 3,
        icon: <FiUnlock></FiUnlock>,
        name: "listuser3"
    },
    {
        id: 4,
        icon: <FiStar></FiStar>,
        name: "listuser4"
    },
    {
        id: 5,
        icon: <FiLogOut></FiLogOut>,
        name: "listuser5"
    },

]
const UserList = () => {

    return (
        <div className='bg-blue-500 px-4 py-2'>
            {listMenuUser.map((item: any, index: any) => (
                <div key={item.index} className='flex'>
                    <div className='setIcon'>{item.icon}</div>
                    <div className='text-[14px]'>{item.name}</div>
                </div>
            ))}
        </div>
    );
};

export default UserList;
